import { ChainSpecificAddress, type Hash256 } from '@l2beat/shared-pure'
import { expect, mockObject } from 'earl'

import { DebugTransactionCallResponse } from '../../provider/DebugTransactionTrace'
import type { IProvider } from '../../provider/IProvider'
import { ArbitrumActorsHandler } from './ArbitrumActorsHandler'

describe(ArbitrumActorsHandler.name, () => {
  it('returns validators from the traces that add and remove them', async () => {
    const handler = new ArbitrumActorsHandler('validators', {
      type: 'arbitrumActors',
      actorType: 'validator',
    })

    const contractAddress = ChainSpecificAddress.random()

    const provider = mockObject<IProvider>({
      getLogs: async () => EXAMPLE_VALIDATORS_LOGS,
      getDebugTrace: async (transactionHash: Hash256) => {
        return DebugTransactionCallResponse.parse(
          EXAMPLE_VALIDATORS_TRACES[transactionHash.toString()],
        )
      },
    })

    const response = await handler.execute(provider, contractAddress)

    expect(response).toEqual({
      field: 'validators',
      value: [
        '0x54c0D3d6C101580dB3be8763A2aE2c6bb9dc840c',
        '0xF8D3E1cF58386c92B27710C6a0D8A54c76BC6ab5',
      ],
    })
  })

  it('returns batch posters from the traces that add and remove them', async () => {
    const handler = new ArbitrumActorsHandler('batchPosters', {
      type: 'arbitrumActors',
      actorType: 'batchPoster',
    })

    const contractAddress = ChainSpecificAddress.random()

    const provider = mockObject<IProvider>({
      getLogs: async () => EXAMPLE_BATCHPOSTERS_LOGS,
      getDebugTrace: async (transactionHash: Hash256) => {
        return DebugTransactionCallResponse.parse(
          EXAMPLE_BATCHPOSTERS_TRACES[transactionHash.toString()],
        )
      },
    })

    const response = await handler.execute(provider, contractAddress)

    expect(response).toEqual({
      field: 'batchPosters',
      value: ['0x0C5911d57B24FCF1DC8B2608eFbAe57C7098E32D'],
    })
  })
})

